def solution():
    # Define the recursive function to count the ways to climb stairs
    def count_ways(steps_left, can_step_on_fifth):
        if steps_left < 0:
            return 0
        elif steps_left == 0:
            return 1
        # If stepping on fifth step is not allowed and there's only 1 step left to it
        elif steps_left == 1 and not can_step_on_fifth:
            return 0
        else:
            # If currently on the fourth step and the next step is the fifth
            if steps_left == 5 and can_step_on_fifth:
                # Avoid the next step - the muddy fifth step
                return count_ways(steps_left - 1, False)
            else:
                # Sum the ways to climb 1, 2 or 3 steps at a time
                return (count_ways(steps_left - 1, True) +
                        count_ways(steps_left - 2, True) +
                        count_ways(steps_left - 3, True))

    # Calculate the number of different ways to climb up the stairs
    ans = count_ways(10, True)

    return ans

ans = solution()

