from sympy import divisors

def solution():
    all_numbers = set(range(1, 14))
    # Since two students put up their hands, they must have the numbers whose number of factors could be determined uniquely
    # We find such numbers within the given range
    numbers_with_unique_number_of_factors = {number for number in all_numbers if sum(len(divisors(other)) == len(divisors(number)) for other in all_numbers) == 1}

    # Alice knows her number is odd, so we remove even numbers from all possibilities
    possible_alice_numbers = {number for number in all_numbers if number % 2 == 1}
    # May's number is smaller than Alice's by 2, and since Alice has an odd number, May's must be odd too.
    # We consider the pair (May's number, Alice's number)
    possible_pairs = {(num - 2, num) for num in possible_alice_numbers if num - 2 in all_numbers}

    # Now, we need to find a pair where both numbers have a unique number of factors, so they could raise their hands.
    for may, alice in possible_pairs:
        if may in numbers_with_unique_number_of_factors and alice in numbers_with_unique_number_of_factors:
            # Now we remove May's and Alice's numbers from all numbers to find the unchosen ones
            remaining_numbers = all_numbers - {may, alice}
            # Among the remaining numbers, there should be Mark's number, which is May's number minus 1
            mark_number = may - 1
            if mark_number in remaining_numbers:
                # Now we have May's, Alice's, and Mark's numbers, we eliminate them from the unchosen numbers
                remaining_numbers.remove(mark_number)
                # The product of the rest should be the answer
                ans = 1
                for num in remaining_numbers:
                    ans *= num
                return ans
    return None

ans = solution()

