    for perm in permutations(vertices, 6):
        graph = {v: set() for v in vertices}
        graph[perm[0]].add(perm[1])
        graph[perm[1]].add(perm[0])

        graph[perm[2]].add(perm[3])
        graph[perm[3]].add(perm[2])

        graph[perm[4]].add(perm[5])
        graph[perm[5]].add(perm[4])

        connected = True
        for v in vertices:
            if len(graph[v]) == 0:
                connected = False
                break
            if connected:
                visited = set()

                def dfs(v):
                    if v in visited:
                        return
                    visited.add(v)
                    for neigh in graph[v]:
                        if neigh not in visited:
                            dfs(neigh)

                dfs(perm[0])  # start DFS from the first vertex in the permutation
                if len(visited) == 6:
                    ans += 1

    # 48 permutations are counted multiple times since we can 
