    def subfactorial(n):
        if n == 0:
            return 1
        elif n == 1:
            return 0
        else:
            return (n - 1) * (subfactorial(n - 1) + subfactorial(n - 2))

    # Calculate the subfactorial (derangement) for 6 students
    ans = subfactorial(6)
    return ans

