def solution():
    cards = [6, 12, 35, 175, 245, 300]
    # Calculate all possible products for Candy (2 cards) and Candice (3 cards)
    candy_products = {i[0] * i[1] for i in combinations(cards, 2)}
    candice_products = {i[0] * i[1] * i[2] for i in combinations(cards, 3)}
    # Find common products
    common_products = candy_products.intersection(candice_products)
    # Find which card is not used in generating these common products
    unused_cards = set(cards)
    for product in common_products:
        for card in cards:
