from itertools import combinations
from math import prod

def solution():
    # All possible numbers from 1 to 13
    numbers = set(range(1, 14))

    # Function to count the number of factors of a number
    def count_factors(n):
        return sum(n % d == 0 for d in range(1, n + 1))

    # Find all pairs of numbers that have a unique count of factors
    unique_factor_nums = set()
    for num in numbers:
        if all(count_factors(num) != count_factors(other) for other in numbers if other != num):
            unique_factor_nums.add(num)

    # Candidates for Alice since she knows her number is odd
    # Alice's number must be among those with a unique factor count
    alice_candidates = {num for num in unique_factor_nums if num % 2 == 1}

    # Possible sets of 9 numbers
    for possible_set in combinations(numbers, 9):
        # Convert to set for ease of manipulation
        selected_set = set(possible_set)

        # Get the potential numbers for Alice
        alices_number = alice_candidates.intersection(selected_set)

        # Alice should have only 1 possible number and we proceed if this condition holds
        if len(alices_number) == 1:
            alice_number = alices_number.pop()

            # Possible numbers for May
            may_candidates = {num for num in selected_set if num == alice_number - 2}

            # Mark candidates (1 less than May's number)
            mark_candidates = {num - 1 for num in may_candidates if (num - 1) in selected_set}

            # Check if there's a unique solution for May and Mark by checking the lengths
            if len(may_candidates) == 1 and len(mark_candidates) == 1:
                unselected_numbers = numbers - selected_set
                return prod(unselected_numbers)

    return None

ans = solution()

