    from sympy import divisors

    # List of numbers on the cards
    cards = [6, 12, 35, 175, 245, 300]

    # Find all divisors for each product
    divisors_products = {card: set(divisors(card)) for card in cards}

    # Check for any two cards that share divisors with any three other cards
    for i in range(len(cards)):
        for j in range(i+1, len(cards)):
            product_two_cards = cards[i] * cards[j]
            divisors_two = divisors_products[cards[i]].union(divisors_products[cards[j]])
            for k in range(len(cards)):
                if k != i and k != j:
                    for l in range(k+1, len(cards)):
                        if l != i and l != j:
                            for m in range(l+1, len(cards)):
